import React from 'react'
import Card from '../components/card'

class Home extends React.Component {

    componentDidMount () {

    }

    render () {
        const CharacterData = fetch('https://rickandmortyapi.com/api/character/ ')

        CharacterData.then(data => data.json())
        return (
            <div>
                <Card dataToSend={this.AllToons} test="This is a test"></Card>
            </div>
        )
    }
}

export default Home;
